/*Table structure for table `carpark_vehicle_reservation` */

DROP TABLE IF EXISTS `carpark_vehicle_reservation`;

CREATE TABLE `carpark_vehicle_reservation` (
  `carpark_vehicle_reservation_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) DEFAULT NULL,
  `vehicle_id` int(11) DEFAULT NULL,
  `carpark_owner_id` int(11) DEFAULT NULL,
  `date` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `from_time` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `to_time` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `amount` decimal(10,2) DEFAULT NULL,
  `payment_type` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `payment_status` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `reservation_status` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  `updated_at` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`carpark_vehicle_reservation_id`),
  KEY `user_id` (`user_id`),
  KEY `vehicle_id` (`vehicle_id`),
  KEY `carpark_owner_id` (`carpark_owner_id`),
  CONSTRAINT `carpark_vehicle_reservation_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `user` (`user_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `carpark_vehicle_reservation_ibfk_2` FOREIGN KEY (`vehicle_id`) REFERENCES `vehicle` (`vehicle_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `carpark_vehicle_reservation_ibfk_3` FOREIGN KEY (`carpark_owner_id`) REFERENCES `carpark_owner` (`carpark_owner_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

